import { useBreakpoint } from 'common'
import { LucideIcon } from 'lucide-react'
import Link from 'next/link'
import type { ComponentType, SVGProps } from 'react'
import { cn } from 'ui'

export type HeroIcon = ComponentType<SVGProps<SVGSVGElement>>
export type IconType = LucideIcon | HeroIcon

export interface Metadata {
  metaTitle: string
  metaDescription: string
}

export interface HeroSection {
  id: string
  title: string
  h1: JSX.Element
  subheader: JSX.Element[]
  image: JSX.Element
  className?: string
  sectionContainerClassName?: string
  icon?: string
  ctas: {
    label: string
    href: string
    type: 'primary' | 'default'
  }[]
  logos?: {
    name: string
    image: string
  }[]
  footer?: React.ReactNode
  footerPosition?: 'left' | 'right' | 'bottom'
}

export interface Quote {
  icon?: string
  author: string
  authorTitle?: string
  quote: JSX.Element
  avatar: string
}

export interface Quotes {
  id: string
  items: Quote[]
}

export interface Highlight {
  icon?: IconType
  heading: string | JSX.Element
  subheading: string | JSX.Element
  url?: string
}

export interface Feature {
  id?: string
  icon?: IconType | string
  iconNoStroke?: boolean
  heading: string | JSX.Element
  subheading: string | JSX.Element
  img?: JSX.Element
}

export interface FeaturesSection {
  id: string
  label?: string
  heading: JSX.Element
  subheading?: string
  features: Feature[]
  // {
  //   [key: string]: Feature
  // }
}

export interface Testimonials {
  id: string
  label: string
  heading: JSX.Element
  videos: {
    [key: string]: {
      url: string
    }
  }
}

export interface CTASection {
  id: string
  label: string
  heading: JSX.Element | string
  subheading: string
  cta: {
    label: string
    href: string
    type: string
  }
}

export interface FrameworkLinkProps {
  name: string
  icon: string | React.ReactNode
  docs: string
}

export const FrameworkLink = ({ framework }: { framework: FrameworkLinkProps }) => {
  const isXs = useBreakpoint(640)
  return (
    <Link
      href={framework.docs}
      className={cn(
        'group relative p-4 transition-colors duration-200',
        'hover:bg-surface-100 -m-px',
        'flex flex-col items-center gap-2 text-center aspect-square justify-center'
      )}
    >
      <div className="text-foreground-lighter group-hover:text-foreground transition-colors">
        {typeof framework.icon === 'string' ? (
          <svg
            width={isXs ? 35 : 45}
            height={isXs ? 35 : 45}
            fillRule="evenodd"
            clipRule="evenodd"
            viewBox="0 0 61 61"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            <path d={framework.icon} fill="currentColor" />
          </svg>
        ) : (
          framework.icon
        )}
      </div>
      <span className="sr-only text-sm font-medium text-foreground-light group-hover:text-foreground transition-colors">
        {framework.name}
      </span>
    </Link>
  )
}

